/*import logo from './logo.svg';*/
import './App.css';

import Navbar from './components/Navbar/Navbar'
import Intro from './components/Intro/Intro'
import Services from './components/Services/Services';
import Popup from './components/Popup/Popup';

function App() {
  return (
    <div className="App">
      <Popup trigger={true}/>
      <Navbar/>
      <Intro/>
      <Services/>
    </div>
  );
}

export default App;
